///  \brief A structure containing a template for a Periodic effect.
///
///  The struct handles the following effects:
///   - ::SDL_HAPTIC_SINE
///   - ::SDL_HAPTIC_LEFTRIGHT
///   - ::SDL_HAPTIC_TRIANGLE
///   - ::SDL_HAPTIC_SAWTOOTHUP
///   - ::SDL_HAPTIC_SAWTOOTHDOWN
///
///  A periodic effect consists in a wave-shaped effect that repeats itself
///  over time.  The type determines the shape of the wave and the parameters
///  determine the dimensions of the wave.
///
///  Phase is given by hundredth of a degree meaning that giving the phase a value
///  of 9000 will displace it 25% of its period.  Here are sample values:
///   -     0: No phase displacement.
///   -  9000: Displaced 25% of its period.
///   - 18000: Displaced 50% of its period.
///   - 27000: Displaced 75% of its period.
///   - 36000: Displaced 100% of its period, same as 0, but 0 is preferred.
///
///  Examples:
///  \verbatim
///SDL_HAPTIC_SINE
///__      __      __      __
////  \    /  \    /  \    /
////    \__/    \__/    \__/
///
///SDL_HAPTIC_SQUARE
///__    __    __    __    __
///|  |  |  |  |  |  |  |  |  |
///|  |__|  |__|  |__|  |__|  |
///
///SDL_HAPTIC_TRIANGLE
////\    /\    /\    /\    /\
////  \  /  \  /  \  /  \  /
////    \/    \/    \/    \/
///
///SDL_HAPTIC_SAWTOOTHUP
////|  /|  /|  /|  /|  /|  /|
//// | / | / | / | / | / | / |
////  |/  |/  |/  |/  |/  |/  |
///
///SDL_HAPTIC_SAWTOOTHDOWN
///\  |\  |\  |\  |\  |\  |\  |
///\ | \ | \ | \ | \ | \ | \ |
///\|  \|  \|  \|  \|  \|  \|
///\endverbatim
///
///  \sa SDL_HAPTIC_SINE
///  \sa SDL_HAPTIC_LEFTRIGHT
///  \sa SDL_HAPTIC_TRIANGLE
///  \sa SDL_HAPTIC_SAWTOOTHUP
///  \sa SDL_HAPTIC_SAWTOOTHDOWN
///  \sa SDL_HapticEffect
#[repr(C)]
#[derive(Copy, Clone)]
pub struct SDL_HapticPeriodic {
    ///< ::SDL_HAPTIC_SINE, ::SDL_HAPTIC_LEFTRIGHT,
    ///::SDL_HAPTIC_TRIANGLE, ::SDL_HAPTIC_SAWTOOTHUP or
    ///::SDL_HAPTIC_SAWTOOTHDOWN
    pub type_: Uint16,
    ///< Direction of the effect.
    pub direction: SDL_HapticDirection,
    ///< Duration of the effect.
    pub length: Uint32,
    ///< Delay before starting the effect.
    pub delay: Uint16,
    ///< Button that triggers the effect.
    pub button: Uint16,
    ///< How soon it can be triggered again after button.
    pub interval: Uint16,
    ///< Period of the wave.
    pub period: Uint16,
    ///< Peak value; if negative, equivalent to 180 degrees extra phase shift.
    pub magnitude: Sint16,
    ///< Mean value of the wave.
    pub offset: Sint16,
    ///< Positive phase shift given by hundredth of a degree.
    pub phase: Uint16,
    ///< Duration of the attack.
    pub attack_length: Uint16,
    ///< Level at the start of the attack.
    pub attack_level: Uint16,
    ///< Duration of the fade.
    pub fade_length: Uint16,
    ///< Level at the end of the fade.
    pub fade_level: Uint16,
}
